<?phpnamespace Winged\Model;class Submenu extends Model{    public function __construct()    {        parent::__construct();        return $this;    }    /** @var $id_submenu integer */    public $id_submenu;    /** @var $id_menu integer */    public $id_menu;    /** @var $pagina string */    public $pagina;    /** @var $nome string */    public $nome;    /** @var $link string */    public $link;    /** @var $permissao string */    public $permissao;    public static function tableName()    {        return "submenu";    }        public static function primaryKeyName()    {        return "id_submenu";    }        public function primaryKey($pk = false)    {        if($pk && (is_int($pk) || intval($pk) != 0)){            $this->id_submenu = $pk;            return $this;        }        return $this->id_submenu;    }        public function behaviors()    {        return [];    }        public function reverseBehaviors()    {        return [];    }        public function labels()    {        return [];    }        public function rules()    {        return [];    }    public function messages()    {        return [];    }}